INSERT INTO `business_functions` VALUES (1,'311','The City\'s 311 system functions to provide a point of entry for residents, business owners and visitors that need easy access to information regarding City programs, services and events. As well, the system documents all requests for non-emergency City services and serves as a routing and work-order clearinghouse, assisting City departments, governmental and non-governmental agencies to manage resources more efficiently and improve customer service. The 311 system also serves as the backup for the 911 system.\r\n<p></p>'),(2,'Administration & Finance','The administrative and finance function serves to evaluate, administer and enforce many aspects of City operations, and ensure efficient and effective performance of those operations, as well as provide management of the City\'s financial resources. Aspects of City operations for which this function is responsible include Business Affairs and Consumer Protection, Business Licensing, Budget and Management, Finance, Human Resources, and Procurement Services.\r\n<p></p>'),(3,'Business & Economic Development','This function provides a wide spectrum of programs aimed at encouraging economic growth and development in the City. These programs include those that promote both private and public investment in building and repairing infrastructure, reclaim vacant properties, clean polluted land, develop sustainable buildings, businesses and urban developments, as well as facilitate the delivery of workforce services specific to business expansion, relocation and stabilization.\r\n<p></p>'),(4,'Education','One of the major functions of the City is to educate its residents and visitors whether in a classroom or library or a train station. Departments across the city including the Chicago Public Schools, Chicago Public Libraries, Chicago Cook Workforce Partnership, City Colleges of Chicago, Department of Public Health, Department of Business Affairs and Consumer Protection, and the Chicago Park District all offer a diversity of programs, tools and resources for the benefit of citizens and visitors of Chicago.\r\n<p></p>'),(5,'Ethics','The function of Ethics in the City is broadly achieved by educating persons subject to the City ordinances and the public about the standards imposed by the ordinances, auditing the City Council\'s operations, investigating allegations of misconduct within City government and departments, providing recommendations and dispositions in cases of findings, and generating, in some cases, publicly available reports on the process and results of these investigations.\r\n<p></p>'),(6,'Health & Human Services','This function supports a continuum of coordinated services that sustain, strengthen and enhance the lives of Chicago residents, particularly those most in need, throughout their lives.  These services include resources and programs provided by the departments of Family and Support Services, Public Health, and Water Management. These departments offer direct services to families in need, for example victims of domestic violence, abuse and neglect or the elderly; they work with community-based organizations, social service providers, and other agencies to provide assistance, support and education to the residents and the public, ensure a safe food and water supply, and work to promote health and prevent disease within the City.\r\n<p></p>'),(7,'Infrastructure & Public Works','The primary intent of this function is to keep the City\'s streets\' clear and traffic moving smoothly and safely. In broader terms the mission is to provide a safe and healthy environment on the streets and alleys of Chicago through the effective management of the collection, disposal and recycling of residential refuse, the sweeping and plowing of streets, the timely removal of graffiti, the cleaning of vacant lots, the demolition of garages, the efficient towing of illegally parked vehicles, the abatement of rodents and the planting, trimming and removal of trees, while also keeping the City\'s surface transportation networks and public way safe for users, environmentally sustainable, in a state of good repair and attractive.\r\n<p></p>'),(8,'Parks & Recreation','The City\'s Parks & Recreation system functions to provide a safe, inviting, and beautifully maintained parks and recreations system available and marketed to the residents and the millions of visitors that pass through the city. The system also acts to foster the development of Chicago\'s nonprofit arts sector, independent working artists.\r\n<p></p>'),(9,'Places & Boundaries','This function primarily revolves around urban planning in the City, including developing and implementing citywide and neighborhood land use plans and managing the Chicago Plan Commission. It is also responsible for reviewing planned developments, lakefront protection applications, and proposed zoning changes in industrial corridors.\r\n<p></p>'),(10,'Public Safety','Public Safety being a primary concern of the City of Chicago, this function serves to protect the safety of both the public and animals through multiple avenues including fire safety education, emergency response and care, extinguishing fires, providing animal shelter, pet placement, animal law enforcement, protection of lives and property, maintenance of law and order, and human law enforcement.\r\n<p></p>'),(11,'Buildings, Housing & Property','This City function supports the safety and shelter requirements of the City\'s residents and visitors through the enforcement of the City\'s building codes, promotion of the preservation, conservation, rehabilitation and reuse of the City\'s existing buildings, provision of financial assistance for housing improvements, facilitation of access to independent living for seniors and the disabled, and implementation of programs to aid residents in reducing property taxes, locating affordable housing, refinancing mortgages, and avoiding foreclosure.\r\n<p></p>');
