INSERT INTO `databases` VALUES (48,'Attendance System','This system tracks attendance data of registered and non-registered seniors at regional and satellite senior centers. Primary user is Senior Services.','Department of Family & Support Services','1615 West Chicago Avenue\r\n5th Floor\r\nChicago, IL 60622-5127\r\n\r\nContact: Matt Smith\r\n312-743-2031\r\nmatt.smith@cityofchicago.org','April 2010-present','Access','Attendance was custom-built for DFSS in 2010 and it has been modified as needed subsequently. Data in the system is added and updated daily. The system shares tables from the Department\\\'s Participant ID system.','The primary user of this system is Senior Services.  Ã¢â‚¬Å“Non-registeredÃ¢â‚¬Â seniorsÃ¢â‚¬â„¢ attendance is not included in reporting from this system. This system will be replaced by ECM.',1,4,511,'2013-02-20 15:13:00','2013-04-11 19:36:00',6),(50,'Senior Participant ID System','This system creates ID cards and tracks demographics about registered seniors.','Department of Family & Support Services','1615 West Chicago Avenue\r\n5th Floor\r\nChicago, IL 60622-5127\r\n\r\nContact: Matt Smith\r\n312-743-2031\r\nmatt.smith@cityofchicago.org','Jan-03','Access, EPI Suite','The Senior Participant ID System is a combination of commercial software (EPI Suite) and a custom-built Access system for DFSS. The system has been rarely updated during it\\\'s existence. Data is added and updated daily.','The Senior Participant ID System\\\'s primary user is Senior Services.',1,4,167,'2013-02-20 15:47:00','2013-04-11 19:37:00',6),(54,'Participation Reports','Used to collect the number of daily participants per activity at each senior center or satellite. Used by Regional Director, Program Director, or other staff to track number of participants by activity for reporting purposes.','Department of Family & Support Services','1615 West Chicago Avenue\r\n5th Floor\r\nChicago, IL 60622-5127\r\n\r\nContact: Matt Smith\r\n312-743-2031\r\nmatt.smith@cityofchicago.org','Current month','Caspio, Access','Data is added and updated monthly. Only current month data is kept online, other data is archived.','Participation Reports was created in Caspio as a web-based application. Data from this system is downloaded to local Access database for DFSS needs.',1,4,185,'2013-02-20 19:48:00','2013-04-11 19:38:00',6),(56,'Federal Funding Accountability and Transparency Act (FFATA) Application','FFATAA is used to collect delegate agencies\\\' top five most highly-compensated executivesÃ¢â‚¬â„¢ compensation information.','Department of Family & Support Services','1615 West Chicago Avenue\r\n5th Floor\r\nChicago, IL 60622-5127\r\n\r\nContact: Matt Smith\r\n312-743-2031\r\nmatt.smith@cityofchicago.org','Current fiscal year','Caspio, Access','FFATAA was custom built for DFSS in October of 2011. Data is added and updated semi-annually or annually.','FFATAA was created in Caspio as a web-based application. Data from this system is downloaded to a local Access database for DFSS needs. Data from this system is also shared with the City of Chicago\\\'s Socrata-based Open Data portal.',1,4,157,'2013-02-20 21:01:00','2013-04-11 19:39:00',6),(57,'Program Monitoring Tracking Application','This system collects information regarding the findings from monitoring agency programs. It tracks visit dates, programs, program status and findings.','Department of Health & Human Services','1615 West Chicago Avenue\r\n5th Floor\r\nChicago, IL 60622-5127\r\n\r\nContact: Matt Smith\r\n312-743-2031\r\nmatt.smith@cityofchicago.org','April 2009-present','Caspio, Access','Data is added and updated daily.','The Program Monitoring Tracking Data Application was created as a web-based application using Caspio. ',1,4,195,'2013-02-20 22:07:00','2013-04-11 19:40:00',6),(58,'Congregate Dining Meal Count Application','Used to track senior \\\"golden dining\\\" information including meal orders, numbers of participants, and total costs. ','Department of Family & Support Services','1615 West Chicago Avenue\r\n5th Floor\r\nChicago, IL 60622-5127\r\n\r\nContact: Matt Smith\r\n312-743-2031\r\nmatt.smith@cityofchicago.org','September 2009-present','Excel','Data is added and updated daily. The spreadsheet format is updated annually as needed.','This application\\\'s primary user is Senior Services. This system will be replaced by ECM.',1,4,276,'2013-02-20 22:21:00','2013-04-11 19:40:00',6),(61,'Chicago Budget System (CBS)','The CBS database contains the operating budget for the city.','Office of Budget and Management','121 North LaSalle Street \nRoom 604\nChicago, IL 60602\n\nContact: Kelley Quinn\n312-744-7790\nKelley.Quinn@cityofchicago.org ','Current fiscal year','Oracle','CBS was custom-built for the City of Chicago and rolled out in 2002, with subsequent on-going enhancements. Data is added and updated daily in the system for any given fiscal year. Upon completion of a fiscal year, the data is stored for historical reference. Data collection began with the 2003 budget.','The CBS databases receive feeds from 2 systems - CHIPPS and FMPS. The CHIPPS data load contains information regarding HR changes to city personnel which impacts the budget. The FMPS data load contains expenditure data for the City\'s accounting system. CBS is used to populate both appropriation and personnel data on the City\'s Socrata-based open data portal.\n',1,4,726,'2013-02-21 15:33:00','2013-10-03 14:05:31',2),(62,'Capital Project Management (CPM)','The CPM database contains the budget dollars allocated towards capital projects occurring in the city over the past 15 years.','Office of Budget and Management','121 North LaSalle Street \nRoom 604\nChicago, IL 60602\n\nContact: Kelley Quinn\n312-744-7790\nKelley.Quinn@cityofchicago.org \n','September 2003-present','Oracle','CPM is a custom-built database application. Most data that is updated is for the fiscal year. Some historical data is modified when the opportunity arises. Some data gaps occur in the CPM system due to departments not closing/completing a project using the standard system-designed process or system data was not fully available so a placeholder was entered for the data.','Expenditure data is received from the City\'s FMPS accounting system for projects stored in CPM.',1,4,403,'2013-02-21 22:16:00','2013-09-27 20:40:56',2),(63,'Community Development Grant Application (CDGA)','The CDGA database contains information submitted by delegate agencies that have applied for funding using grant dollars available in the budget.','Office of Budget and Management','121 North LaSalle Street\nRoom 604\nChicago, IL 60602\n\nContact: Kelley Quinn\n312-744-7790\nKelley.Quinn@cityofchicago.org ','September 2003-present','Oracle','CDGA is a custom-built database application. Data is updated yearly during the application period. Some historical data is modified when the opportunity arises.','CDGA is linked to the Chicago Budget System (CBS) for budget purposes.',1,4,375,'2013-02-22 15:59:00','2013-09-27 20:36:04',2),(67,'Contracts/Delegate Application','This system is used by the contracts unit to track DFSS contracts, awards, and delegate address information. It is also used for reporting award amounts by agency, division and contract term on a regular basis.','Department of Family & Support Services','1615 West Chicago Avenue\r\n5th Floor\r\nChicago, IL 60622-5127\r\n\r\nContact: Matt Smith\r\n312-743-2031\r\nmatt.smith@cityofchicago.org','2009-present','Caspio, Microsoft Access','The Contracts/Delegate Application was created as a custom-built, web-based application using Caspio and has been infrequently updated since 2009. Data is added and updated daily.','Delegate data is shared with the Executive Approval system.',1,4,173,'2013-02-22 17:35:00','2013-04-11 19:41:00',6),(111,'Statement of Financial Interest (EFIS)','EFIS captures information on certain reporting individuals who may have a financial interest in the work, contracts or business with the City of Chicago in order, among other things, to track those who might have a conflict of interest.','Board of Ethics, Department of Innovation Technology','Board of Ethics\n740 North Sedgwick\nSuite 500\nChicago, Illinois\n60654\n312.744.9660 ','2006-present','Oracle','','',1,11,197,'2013-09-26 19:26:53','2013-09-26 19:34:33',5),(112,'Adult Services Events Database','The Adult Services department at the Chicago Public Library uses this database to plan and coordinate the events overseen by Adult Services.','Chicago Public Library','400 South State Street\nChicago, IL 60605\n(312) 747-4300','December 2012 to current','Sharepoint','The database is very new and much of the content is still being entered and tested. It does not show the complete run of programs that the Adult Services department has done as this is still being updated. ','',1,11,187,'2013-09-26 19:42:58','2013-09-26 19:43:46',4),(113,'Finance Department Spreadsheets','Spreadsheets are used for internal tracking of all branch/unit locations of various financial information as it relates to managing, compiling, tracking, auditing, reconciliation, etc.','Chicago Public Library','400 South State Street\nChicago, IL 60605\n(312) 747-4300','2003 to current','Excel, Access ','Data is updated daily and monthly and contains some historical and current information.','Spreadsheets are for internal use only by Finance Department staff.',1,11,178,'2013-09-27 18:18:05','2013-09-27 18:18:58',4);
