INSERT INTO `databases_revisions` VALUES (278,62,'Capital Project Management (CPM)','The CPM database contains the budget dollars allocated towards capital projects occurring in the city over the past 15 years.','Office of Budget and Management','121 North LaSalle Street \nRoom 604\nChicago, IL 60602\n\nContact: Pete Scales\n312-744-1828\npeter.scales@cityofchicago.org \n','September 2003-present','Oracle','CPM is an off-the-shelf database application. Most data that is updated is for the fiscal year. Some historical data is modified when the opportunity arises. Some data gaps occur in the CPM system due to departments no closing/completing a project using the standard system-designed process or system data was not fully available so a placeholder was entered for the data.','Funding data is received from the City\'s FMPS accounting system for projects stored in CPM.',1,11,'2013-05-07 05:19:32'),(279,63,'Community Development Grant Application (CDGA)','The CDGAPROD database contains the delegate information for agencies that have applied for funding using grant dollars available in the budget.','Office of Budget and Management','121 North LaSalle Street\nRoom 604\nChicago, IL 60602\n\nContact: Pete Scales\n312-744-1828\npeter.scales@cityofchicago.org ','September 2003-present','Oracle','CDGAPROD is an off-the-shelf database application. Most data that is updated is yearly during the application period. Some historical data is modified when the opportunity arises.','Information for funding comes from the CBS system (MFPROD).',1,3,'2013-05-07 05:20:08'),(280,61,'Chicago Budget System (CBS)','The CBS database contains the operating budget for the city.','Office of Budget and Management','121 North LaSalle Street \nRoom 604\nChicago, IL 60602\n\nContact: Pete Scales\n312-744-1828\npeter.scales@cityofchicago.org ','Current fiscal year','Oracle','CBS was custom-built for the City of Chicago in 2005 and has been little modified subsequently. Data is added and updated daily in the system for any given fiscal year. Upon completion of a fiscal year, the data is stored for historical reference. Data collection began in January 2006.','The CBS databases receive daily feeds from 2 systems - CHIPPS and FMPS. The CHIPPS data load contains information regarding HR changes to city personnel which impacts the budget. The FMPS data load contains funding data for the City\'s accounting system. CBS is used to populate personnel data on the City\'s Socrata-based open data portal.\n',1,3,'2013-05-07 05:21:22'),(281,63,'Community Development Grant Application (CDGA)','The CDGA database contains the delegate information for agencies that have applied for funding using grant dollars available in the budget.','Office of Budget and Management','121 North LaSalle Street\nRoom 604\nChicago, IL 60602\n\nContact: Pete Scales\n312-744-1828\npeter.scales@cityofchicago.org ','September 2003-present','Oracle','CDGA is an off-the-shelf database application. Most data that is updated is yearly during the application period. Some historical data is modified when the opportunity arises.','Information for funding comes from the CBS system.',1,3,'2013-05-07 05:36:57'),(282,61,'Chicago Budget System (CBS)','The CBS database contains the operating budget for the city.','Office of Budget and Management','121 North LaSalle Street \nRoom 604\nChicago, IL 60602\n\nContact: Pete Scales\n312-744-1828\npeter.scales@cityofchicago.org ','Current fiscal year','Oracle','CBS was custom-built for the City of Chicago in 2005 and has been little modified subsequently. Data is added and updated daily in the system for any given fiscal year. Upon completion of a fiscal year, the data is stored for historical reference. Data collection began in January 2006.','The CBS databases receive daily feeds from 2 systems - CHIPPS and FMPS. The CHIPPS data load contains information regarding HR changes to city personnel which impacts the budget. The FMPS data load contains funding data for the City\'s accounting system. MFPROD is used to populate personnel data on the City\'s Socrata-based open data portal.\n',1,11,'2013-05-07 05:52:00'),(323,61,'Chicago Budget System (CBS)','The CBS database contains the operating budget for the city.','Office of Budget and Management','121 North LaSalle Street \nRoom 604\nChicago, IL 60602\n\nContact: Kelley Quinn\n312-744-1828\npeter.scales@cityofchicago.org ','Current fiscal year','Oracle','CBS was custom-built for the City of Chicago in 2005 and has been little modified subsequently. Data is added and updated daily in the system for any given fiscal year. Upon completion of a fiscal year, the data is stored for historical reference. Data collection began in January 2006.','The CBS databases receive daily feeds from 2 systems - CHIPPS and FMPS. The CHIPPS data load contains information regarding HR changes to city personnel which impacts the budget. The FMPS data load contains funding data for the City\'s accounting system. CBS is used to populate personnel data on the City\'s Socrata-based open data portal.\n',1,3,'2013-09-25 17:17:47'),(324,63,'Community Development Grant Application (CDGA)','The CDGA database contains the delegate information for agencies that have applied for funding using grant dollars available in the budget.','Office of Budget and Management','121 North LaSalle Street\nRoom 604\nChicago, IL 60602\n\nContact: Kelley Quinn\n312-744-1828\npeter.scales@cityofchicago.org ','September 2003-present','Oracle','CDGA is an off-the-shelf database application. Most data that is updated is yearly during the application period. Some historical data is modified when the opportunity arises.','Information for funding comes from the CBS system.',1,3,'2013-09-25 17:18:14'),(325,62,'Capital Project Management (CPM)','The CPM database contains the budget dollars allocated towards capital projects occurring in the city over the past 15 years.','Office of Budget and Management','121 North LaSalle Street \nRoom 604\nChica