a that is updated is for the fiscal year. Some historical data is modified when the opportunity arises. Some data gaps occur in the CPM system due to departments no closing/completing a project using the standard system-designed process or system data was not fully available so a placeholder was entered for the data.','Funding data is received from the City\'s FMPS accounting system for projects stored in CPM.',1,3,'2013-09-26 14:34:19'),(328,63,'Community Development Grant Application (CDGA)','The CDGA database contains the delegate information for agencies that have applied for funding using grant dollars available in the budget.','Office of Budget and Management','121 North LaSalle Street\nRoom 604\nChicago, IL 60602\n\nContact: Kelley Quinn\n312-744-7790\nKelley.Quinn@cityofchicago.org ','September 2003-present','Oracle','CDGA is an off-the-shelf database application. Most data that is updated is yearly during the application period. Some historical data is modified when the opportunity arises.','Information for funding comes from the CBS system.',1,3,'2013-09-26 14:35:01'),(330,111,' Lobbyist Registrations and Reporting System (ELF)','This database contains information regarding all lobbyists for the City of Chicago. Lobbyists must register within five days of beginning any lobbying activity. This database tracks those individuals that have registered, their clients, employers and the actual lobbying activity they have engaged in.','Board of Ethics, Department of Innovation Technology','\nBoard of Ethics\n740 North Sedgwick\nSuite 500\nChicago, Illinois\n60654\n312.744.9660 ','2006-present','Oracle & Access','ELF was custom-built for the City of Chicago by CROW in 2006 and overhauled in 2010. Data is updated daily.','ELF feeds the City of Chicago\'s Socrata-based open data portal. Lobbyist information is uploaded daily to this system.',1,11,'2013-09-26 19:26:53'),(331,111,' Lobbyist Registrations and Reporting System (ELF)','This database contains information regarding all lobbyists for the City of Chicago. Lobbyists must register within five days of beginning any lobbying activity. This database tracks those individuals that have registered, their clients, employers and the actual lobbying activity they have engaged in.','Board of Ethics, Department of Innovation Technology','Board of Ethics\n740 North Sedgwick\nSuite 500\nChicago, Illinois\n60654\n312.744.9660 ','2006-present','Oracle & Access','ELF was custom-built for the City of Chicago by CROW in 2006 and overhauled in 2010. Data is updated daily.','ELF feeds the City of Chicago\'s Socrata-based open data portal. Lobbyist information is uploaded daily to this system.',1,11,'2013-09-26 19:28:18'),(332,111,' Statement of Financial Interest (EFIS)','EFIS captures information on certain reporting individuals who may have a financial interest in the work, contracts or business with the City of Chicago in order, among other things, to track those who might have a conflict of interest.','Board of Ethics, Department of Innovation Technology','Board of Ethics\n740 North Sedgwick\nSuite 500\nChicago, Illinois\n60654\n312.744.9660 ','2006-present','Oracle','','',1,11,'2013-09-26 19:34:33'),(333,112,'Adult Services Events Database','The Adult Services department at the Chicago Public Library uses this database to plan and coordinate the events overseen by Adult Services.','Chicago Public Library','400 South State Street\nChicago, IL 60605\n(312) 747-4300','December 2012 to current','Sharepoint','The database is very new and much of the content is still being entered and tested. It does not show the complete run of programs that the Adult Services department has done as this is still being updated. ','',1,11,'2013-09-26 19:42:58'),(334,112,'Adult Services Events Database','The Adult Services department at the Chicago Public Library uses this database to plan and coordinate the events overseen by Adult Services.','Chicago Public Library','400 South State Street\nChicago, IL 60605\n(312) 747-4300','December 2012 to current','Sharepoint','The database is very new and much of the content is still being entered and tested. It does not show the complete run of programs that the Adult Services department has done as this is still being updated. ','',1,11,'2013-09-26 19:43:46'),(335,113,'Finance Department Spreadsheets','Spreadsheets are used for internal tracking of all branch/unit locations of various financial information as it relates to managing, compiling, tracking, auditing, reconciliation, etc.','Chicago Public Library','400 South State Street\nChicago, IL 60605\n(312) 747-4300','2003 to current','Excel, Access ','Data is updated daily and monthly and contains some historical and current information.','Spreadsheets are for internal use only by Finance Department staff.',1,11,'2013-09-27 18:18:05'),(336,113,'Finance Department Spreadsheets','Spreadsheets are used for internal tracking of all branch/unit locations of various financial information as it relates to managing, compiling, tracking, auditing, reconciliation, etc.','Chicago Public Library','400 South State Street\nChicago, IL 60605\n(312) 747-4300','2003 to current','Excel, Access ','Data is updated daily and monthly and contains some historical and current information.','Spreadsheets are for internal use only by Finance Department staff.',1,11,'2013-09-27 18:18:58'),(337,63,'Community Development Grant Application (CDGA)','The CDGA database contains information submitted by delegate agencies that have applied for funding using grant dollars available in the budget.','Office of Budget and Management','121 North LaSalle Street\nRoom 604\nChicago, IL 60602\n\nContact: Kelley Quinn\n312-744-7790\nKelley.Quinn@cityofchicago.org ','September 2003-present','Oracle','CDGA is a custom-built database application. Data is updated yearly during the application period. Some historical data is modified when the opportunity arises.','CDGA is linked to the Chicago Budget System (CBS) for budget purposes.',1,3,'2013-09-27 20:36:04'),(338,61,'Chicago Budget System (CBS)','The CBS database contains the operating budget for the city.','Office of Budget and Management','121 North LaSalle Street \nRoom 604\nChicago, IL 60602\n\nContact: Kelley Quinn\n312-744-7790\nKelley.Quinn@cityofchicago.org ','Current fiscal year','Oracle','CBS was custom-built for the City of Chicago and rolled out in 2002, with subsequent on-going enhancements. Data is added and updated daily in the system for any given fiscal year. Upon completion of a fiscal year, the data is stored for historical reference. Data collection began with the 2003 budget.','The CBS databases receive daily feeds from 2 systems - CHIPPS and FMPS. The CHIPPS data load contains information regarding HR changes to city personnel which impacts the budget. The FMPS data load contains funding data for the City\'s accounting system. CBS is used to populate personnel data on the City\'s Socrata-based open data portal.\n',1,3,'2013-09-27 20:38:34'),(339,62,'Capital Project Management (CPM)','The CPM database contains the budget dollars allocated towards capital projects occurring in the city over the past 15 years.','Office of Budget and Management','121 North LaSalle Street \nRoom 604\nChicago, IL 60602\n\nContact: Kelley Quinn\n312-744-7790\nKelley.Quinn@cityofchicago.org \n','September 2003-present','Oracle','CPM is a custom-built database application. Most data that is updated is for the fiscal year. Some historical data is modified when the opportunity arises. Some data gaps occur in the CPM system due to departments not closing/completing a project using the standard system-designed process or system data was not fully available so a placeholder was entered for the data.','Expenditure data is received from the City\'s FMPS accounting system for projects stored in CPM.',1,3,'2013-09-27 20:40:56'),(340,61,'Chicago Budget System (CBS)','The CBS database contains the operating budget for the city.','Office of Budget and Management','121 North LaSalle Street \nRoom 604\nChicago, IL 60602\n\nContact: Kelley Quinn\n312-744-7790\nKelley.Quinn@cityofchicago.org ','Current fiscal year','Oracle','CBS was custom-built for the City of Chicago and rolled out in 2002, with subsequent on-going enhancements. Data is added and updated daily in the system for any given fiscal year. Upon completion of a fiscal year, the data is stored for historical reference. Data collection began with the 2003 budget.','The CBS databases receive feeds from 2 systems - CHIPPS and FMPS. The CHIPPS data load contains information regarding HR changes to city personnel which impacts the budget. The FMPS data load contains expenditure data for the City\'s accounting system. CBS is used to populate both appropriation and personnel data on the City\'s Socrata-based open data portal.\n',1,3,'2013-10-03 14:05:31');
